INSERT INTO `it_products` (`id`, `category_id`, `product_name`, `product_is_feature`, `quantity`, `price`, `discounted_price`, `product_sku`, `shipping_region`, `description`, `sheeping_fees`, `warrenty`, `createdby`, `createddate`, `modifiedby`, `modifieddate`, `isactive`, `publish_from`, `publish_to`, `is_na`, `is_offer_publish`) VALUES
(1, 3, 'STR-600 HIGH PERFORMANCE BRAKE FLUID', 1, 100, '17', '10', 1, 'UK, US', 'Engineered to optimize brake system performance at high operating temperatures, StopTech STR-600 High Performance Brake Fluid guards against boiling and loss of efficiency. The brake fluid maintains its viscosity, lubricity and non-compressibility while offering protection from the punishing world of high performance motoring.\r\n\r\nStopTech STR-600 High Performance Brake Fluid is a DOT 4, road-legal motor vehicle brake fluid and is compatible with modern ABS and other vehicle dynamic control systems. The fluid can be mixed with all DOT 3 and DOT 4 products.\r\n\r\nAvailable in 500ml bottle\r\nTypical dry boiling point: 594°F (312°C)\r\nTypical wet boiling point: 404°F (206°C)\r\nMinimum wet boiling point: 383°F (195°C)', '.50', '1', 1, '2017-07-24 18:07:56', 1, '2017-08-16 14:08:48', 1, NULL, NULL, 0, 0),
(2, 3, 'SPORTSTOP DRILLED ROTOR', 1, 500, '72', '2', 2, 'UK, US', 'With an internal vane structure identical to stock rotors, the one-piece StopTech SportStop Drilled Rotor is a direct replacement rotor that fits Original Equipment calipers. Its drilled design helps remove unwanted debris between the pad and disc resulting in increased bite and improved stopping power. This same drilled look for rear brakes can help match the aesthetics of a front big brake kit, too.\r\n\r\n', '1', '1', 1, '2017-07-24 18:07:20', 1, '2017-08-16 14:08:53', 1, NULL, NULL, 0, 0),
(3, 3, 'SPORT SLOTTED CRYO-TREATED ROTOR', 1, 500, '85', '', 3, 'UK, US', 'Long Lasting, Warp-Resistant Brake Rotors\r\n\r\nStopTech has developed the StopTech Cryo cryogenically treated slotted rotors for drivers who want maximum durability from their brake rotors. Although not apparent to the naked eye, rotors treated cryogenically show significant improvements in longevity. Deep cryogenic processing creates dramatic increases in abrasive wear resistance and durability while also reducing residual stresses for an extra level of protection against warping. The rotors are also double disc ground and mill balanced to ensure a consistent friction surface and improved pad bed-in.\r\n\r\nSerious drivers - those who tend to cross the finish line first - take their edge where they can find it. And a growing number of them have embraced the edge that they&amp;#039;ve found in cryogenically treated brake rotors. Here&amp;#039;s why:\r\n\r\nRotors resist cracking, warping and fading.\r\nRotors last 2-3 times longer. Fewer pads and rotors are needed.\r\nRotors stop consistently and predictably.', '1', '1', 1, '2017-07-24 18:07:16', 1, '2017-08-16 14:08:57', 1, NULL, NULL, 0, 0),
(4, 3, 'HIGH PERFORMANCE STREET 5.0 BRAKE PADS', NULL, 500, '121', '1', 5, 'UK', 'Hawk High Performance Street 5.0 Brake Pads improve performance with increased stopping power and resistance to brake fade. Developed as a more responsive and durable option compared to Original Equipment, the pads release low levels of dust in normal street driving conditions while also creating little noise.\r\n\r\nThe pads feature a Ferro-Carbon compound and offer advanced braking characteristics to enhance the driving experience. This new compound combines the safety and quality of aerospace design with the braking technology of motorsports for improved performance under heavy braking situations.', '2', '1', 1, '2017-07-24 18:07:03', 1, '2017-08-16 15:08:37', 1, NULL, NULL, 0, 0),
(5, 1, 'Charming Solitaire Ring', NULL, 1, '85', NULL, 6, 'Uk, US', 'The charming &amp;amp;amp;amp;amp;amp;amp; classy design of this solitaire ring is symbolic of prime and superior beauty of the women. It can be either gifted to your mother ,daughter or better half. The style is really appealing and charming, radiance and sparkle of this solitaire ring will definitely outshine you in the crowd.', '1', '1', 1, '2017-07-24 18:07:37', 1, '2017-08-21 20:08:28', 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 0, 0),
(6, 3, 'PRO-KIT SPRING SET', 1, 200, '234.90', '2', 8, 'UK', 'The Eibach Pro-Kit lowering spring set improves your vehicle&amp;#039;s looks and performance. Pro-Kit springs lower the vehicle&amp;#039;s center of gravity, reducing body roll in the turns, dive under braking, squat during acceleration and give the car a more solid, secure feel at all times. Pro-Kit Springs also minimize the ugly fender gap that makes a car look &amp;quot;lifted.&amp;quot; Eibach Pro-Kit Springs...&amp;quot; The look that performs.&amp;quot;', '1', '1', 1, '2017-07-24 18:07:39', 1, '2017-08-16 14:08:02', 1, NULL, NULL, 0, 0),
(7, 1, 'SCORPION VERDE ALL SEASON - SIZE: 255/45R20', NULL, 100, '115.16', '', 11, 'UK', 'Crugen Premium (KL33) tires are Kumho&amp;amp;#039;s Crossover/SUV Touring All-Season light truck tires originally developed for Original Equipment use on Hyundai Santa Fe crossover vehicles and now available in sizes for a wide range of crossovers, SUVs and light trucks. Combining sophisticated looking low-profile tires and large rim diameter wheels to enhance vehicle appearance; Crugen Premium tires also provide all-season versatility, including traction in light snow.\r\n\r\nWhile the &amp;amp;quot;Crugen Premium&amp;amp;quot; name replaced the &amp;amp;quot;City Venture Premium&amp;amp;quot; name at the end of 2013, there were no tread design, construction nor materials changes. Therefore, Crugen Premium and City Venture Premium tires of equivalent tread depths can be used interchangeably in single applications or axle pairs.', '2', '1', 1, '2017-07-24 18:07:07', 1, '2017-08-16 14:08:32', 1, NULL, NULL, 0, 0),
(8, 1, 'EAGLE RS-A - SIZE: 255/45R20', NULL, 1000, '222.62', '20.60', 13, 'UK, US', 'High Performance All-Season tires are for drivers who want a combination of a sporty appearance, predictable handling and H- or V-speed rated durability along with all-season traction, including in light snow. High Performance All-Season tires branded with the M+S symbol are often used as Original Equipment (O.E.) on sports cars, sporty coupes and performance sedans.\r\n\r\nO.E. High Performance All-Season tires are typically purchased as direct replacements for worn-out pairs/sets of the vehicle&amp;amp;amp;amp;amp;#039;s original tires. They can also be used for other vehicle applications in complete sets of four or axle pairs if available in an appropriate size, load range and speed rating to match the existing O.E. tires&amp;amp;amp;amp;amp;#039; performance category and specifications.', '1', '1', 1, '2017-07-24 18:07:56', 1, '2017-08-16 14:08:39', 1, NULL, NULL, 0, 0),
(9, 2, 'ST4', NULL, 1000, '144', '', 16, 'UK, US, LA', 'he wheel diameter does not match the selected\r\nvehicle&amp;#039;s O.E. tire diameter. To find matching tires,\r\nselect &amp;quot;Build a Tire &amp;amp; Wheel Package.&amp;quot;', '5', '10', 1, '2017-07-24 18:07:02', 1, '2017-08-16 14:08:16', 1, NULL, NULL, 0, 0),
(10, 2, 'ST3', NULL, 500, '144', '4', 19, 'UK, US', 'The wheel diameter does not match the selected\r\nvehicle&amp;amp;#039;s O.E. tire diameter. To find matching tires,\r\nselect &amp;amp;quot;Build a Tire &amp;amp;amp; Wheel Package.&amp;amp;quot;', '1', '10', 1, '2017-07-24 18:07:56', 1, '2017-08-16 14:08:27', 1, NULL, NULL, 0, 0),
(11, 8, 'AR883 MAVERICK', NULL, 500, '154', NULL, 20, 'UK, US', 'Rec. Tire Size:235/60-18\r\nWeight:24.05 lbs.\r\nFinish:Machined w/Black Accent\r\nConstruction:1pc. Gravity Cast\r\nFinish Warranty:1 Year\r\nManufacturer Part #:ST3880455114BMF\r\nManufactured in:China\r\nFeatures\r\n\r\nCenter cap shown included at no charge.', '5', '10', 1, '2017-07-24 18:07:21', 1, '2017-08-21 20:08:14', 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 0, 0),
(12, 8, '0.31-Carat Princess  Diamond', NULL, 1, '234', NULL, 1, 'US', 'This F-color, and SI2 Clarity diamond comes accompanied by a diamond grading report from the IGI', '1', '1', 1, '2017-08-16 15:08:52', 1, '2017-08-21 20:08:28', 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 0, 0),
(13, 2, 'Alloy Pendant For Men &amp; Women', NULL, 1, '233', NULL, 1, 'US', 'This VK Jewels Ganesh With Lord Shankar pendant of lord is developed with pure dedication which creates divinity and consecration towords a lord. The model of the god pendant is made of CAD/CAM design which gives look of real jewellery. This god pendant has high end fashion design which has elegance and style. CHAIN NOT INCLUDED.', '11', '1', 1, '2017-08-16 15:08:20', 1, '2017-08-21 20:08:57', 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 0, 0),
(14, 3, 'FTSS Sports Medal 7 Gold (3 Inches)', NULL, 1, '113', NULL, 1, 'US', 'For In stock products, dispatch will happen within 24 Working hours and the delivery will happen within 1 to 3 days post Dispatch. The products which are currently out of stock can also be manufactured and delivered within 7 to 10 days. Kindly write us at order@trophykart.in for details.', '1', '1', 1, '2017-08-16 15:08:29', 1, '2017-08-21 20:08:49', 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 0, 0),
(15, 5, 'Youbella Fashion Jewellery Stylish Necklace Combo For Girls And Women', NULL, 1, '333', NULL, 2, 'UK', 'Stylish and Trendy Jewellery from the house of YouBella, prefect for all occassions', '1', '1', 1, '2017-08-16 15:08:35', 1, '2017-08-21 20:08:36', 0, '1970-01-01 00:00:00', '1970-01-01 00:00:00', 0, 0),
